import React from "react";
import {
  barbellSharp,
  playSharp,
  location,
  call,
  mail,
  logoFacebook,
  logoInstagram,
  logoTwitter,
  caretUpSharp,
  chevronForwardSharp,
} from "ionicons/icons";
import { IonIcon } from "@ionic/react"; // Assuming ionic/react is installed; else replace icons accordingly

const Home = () => {
  return (
    <>
      {/* Header */}
      <header className="header fixed-top bg-white shadow-sm py-2">
        <div className="container d-flex justify-content-between align-items-center">
          <a href="#" className="d-flex align-items-center text-decoration-none">
            <IonIcon icon={barbellSharp} style={{ color: "#f44336", fontSize: 40, transform: "rotate(90deg) translate(-2px, -5px)" }} />
            <span
              className="ms-2 fw-bold"
              style={{ fontFamily: "'Catamaran', sans-serif", fontSize: "2.8rem", color: "#152947" }}
            >
              Fitlife
            </span>
          </a>

          <nav className="d-none d-lg-block">
            <ul className="nav">
              {["Home", "About Us", "Classes", "Blog", "Contact Us"].map((text, idx) => (
                <li key={idx} className="nav-item">
                  <a href={`#${text.toLowerCase().replace(" ", "")}`} className={`nav-link px-3 ${idx === 0 ? "active fw-bold" : ""}`}>
                    {text}
                  </a>
                </li>
              ))}
            </ul>
          </nav>

          <a href="#" className="btn btn-outline-danger d-none d-lg-inline-block text-uppercase px-4 fw-semibold">
            Join Now
          </a>

          {/* Mobile menu button if needed */}
        </div>
      </header>

      {/* Main */}
      <main>
        {/* Hero Section */}
        <section
          id="home"
          aria-label="hero"
          className="position-relative bg-dark text-white overflow-hidden"
          style={{
            backgroundImage: "url('./assets/images/hero-bg.png')",
            backgroundRepeat: "no-repeat",
            backgroundPosition: "top left",
            paddingTop: "160px", // mimic section padding + hero offset
            paddingBottom: 0,
          }}
        >
          <div className="container d-lg-grid" style={{ gridTemplateColumns: "1fr 1fr", gap: "2rem", alignItems: "center" }}>
            <div className="text-center text-lg-start mb-5 mb-lg-0">
              <p className="d-inline-block bg-white-10 text-danger py-1 px-3 rounded text-uppercase fw-bold fs-5" style={{ fontFamily: "'Catamaran', sans-serif", letterSpacing: "1px" }}>
                <strong className="bg-danger px-3 rounded me-3">The Best</strong>Fitness Club
              </p>

              <h1 className="display-1 fw-bold mt-3" style={{ fontFamily: "'Catamaran', sans-serif" }}>
                Work Hard To Get Better Life
              </h1>

              <p className="lead text-secondary my-4" style={{ maxWidth: "450px", marginLeft: "auto", marginRight: "auto", marginLeft: 0 }}>
                Duis mollis felis quis libero dictum vehicula. Duis dictum lorem mi, a faucibus nisi eleifend eu.
              </p>

              <a href="#" className="btn btn-danger btn-lg text-uppercase fw-semibold">
                Get Started
              </a>
            </div>

            <div className="position-relative mx-auto" style={{ maxWidth: 660 }}>
              <img src="./assets/images/hero-banner.png" alt="hero banner" width="660" height="753" className="img-fluid" />

              {/* Decorative circles & icons */}
              <img src="./assets/images/hero-circle-one.png" className="position-absolute top-50 start-50 translate-middle rounded-circle" alt="" style={{ width: "666px", height: "666px", zIndex: -1, animation: "rotate360 15s linear infinite" }} aria-hidden="true" />
              <img src="./assets/images/hero-circle-two.png" className="position-absolute top-50 start-50 translate-middle rounded-circle" alt="" style={{ width: "666px", height: "666px", zIndex: -2, animation: "rotate360Reverse 15s linear infinite" }} aria-hidden="true" />
              <img src="./assets/images/heart-rate.svg" alt="heart rate" className="position-absolute" style={{ top: 20, right: "-50px", width: 190, animation: "move 3s linear infinite alternate" }} />
              <img src="./assets/images/calories.svg" alt="calories" className="position-absolute" style={{ bottom: -50, left: "-40px", width: 280, animation: "moveReverse 3s linear infinite alternate" }} />
            </div>
          </div>
        </section>

        {/* Other sections (About, Video, Classes, Blog, Footer) */}
        {/* You can similarly layout other sections using Bootstrap grid and utilities */}

      </main>

      {/* Back to Top Button */}
      <a href="#top" className="btn btn-danger rounded-circle position-fixed" style={{ bottom: 20, right: 40, width: 44, height: 44, display: "none" }} aria-label="Back to top" id="backToTopBtn">
        <IonIcon icon={caretUpSharp} style={{ fontSize: 20, color: "#152947" }} />
      </a>

      {/* Include custom keyframes and styles in your CSS or styled components */}
      <style jsx>{`
        @keyframes rotate360 {
          0% {
            transform: translate(-50%, -56%) rotate(0);
          }
          100% {
            transform: translate(-50%, -56%) rotate(1turn);
          }
        }
        @keyframes rotate360Reverse {
          0% {
            transform: translate(-50%, -56%) rotate(0);
          }
          100% {
            transform: translate(-50%, -56%) rotate(-1turn);
          }
        }
        @keyframes move {
          0% { transform: translate(0, 0); }
          50% { transform: translate(-5px, 10px); }
          100% { transform: translate(5px, 20px); }
        }
        @keyframes moveReverse {
          0% { transform: translate(0, 0); }
          50% { transform: translate(5px, -10px); }
          100% { transform: translate(-5px, -20px); }
        }
      `}</style>
    </>
  );
};

export default Home;
